import React from "react";

function About() {
  return;
  <Grid
    container
    spacing={2}
    justifyContent="center"
    alignItems="center"
    mt={3}
  >
    <Grid item xs={12} lg={12}>
      <IntroduceText firstLine="About" secondLine="Partners" />
    </Grid>
  </Grid>;
}

export default About;
